import React from "react";
import styled from "styled-components";
import Page from "../../global/Page";
import AboutAccents from "./components/AboutAccents";
const About = () => {
    return (
        <Page>
            <AboutAccents />
            <Card>
                <div className='image1 image'>
                    <div className='accent' />
                </div>
                <div className='name'>Kelvin De Los Angeles</div>
                <div className='icon'>Icon</div>
                <div className='blurb'>
                    Lorem ipsum dolor sit amet consectetur, adipisicing elit. Fugiat magnam exercitationem, facere cumque nobis reprehenderit tempora
                    asperiores voluptatibus! Sequi in, debitis sapiente iste iusto neque consequuntur ipsum amet, vitae consectetur, a inventore. In
                    libero qui nihil doloribus corporis? Id quibusdam odio impedit quisquam excepturi dolor eos minus atque officiis aliquid.
                </div>
            </Card>
        </Page>
    );
};

const Card = styled.div`
    display: grid;
    /* max-width: 343px; */
    width: 100%;
    grid-template-columns: repeat(2, auto);
    grid-template-areas:
        "image image"
        "name icon"
        "blurb blurb";
    .name {
        grid-area: name;
    }
    .icon {
        grid-area: icon;
    }
    .blurb {
        grid-area: blurb;
    }
    .image {
        grid-area: image;
        margin-bottom: 40px;
    }

    .image1 {
        position: relative;
        height: 199px;
        width: 199px;
        background-color: tomato;
        .accent {
            height: 199px;
            width: 199px;
            background-color: green;
            /* position: absolute; */
            right: -20px;
            bottom: -20px;
            z-index: -2;
        }
    }
`;

export default About;
